import React, {useState} from 'react'
import Navbar from './components/Navbar';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import './App.css';
import Home from ''

function App() {
  return (
    <>
      <Router>
				<Navbar>
					<Switch>
						<Route path = '/' exact component={Home}/>
					</Switch>
				</Navbar>
			</Router>
    </>
  )
}

export default App
